INSERT INTO `tb_resposta_completa` VALUES (1,'2','Não existem grandes alterações a serem feitas, são apenas detalhes que podem ser melhorados.','Atenção e retorno às sugestões de melhorias.','2','2','2','2','1','1','2','1',109,'2015-01-14 21:05:25'),(2,'2','PRESTAÇÃO SERVIÇOS GERAIS.','MAIOR PERIODO PARA RECEBIMENTO DE MATERIAIS TRANSFERIDOS.\r\nAGILIDADE NO RECEBIMENTO DOS MESMOS,','2','2','2','2','2','2','2','2',81,'2015-01-15 12:19:51'),(3,'2','Na verdade ainda precisa de melhorias','Menos burocracia e melhorias nos controles','3','3','3','2','3','3','2','2',79,'2015-01-16 09:41:52'),(4,'1','qualidade no trabalho, parceria, agilidade, organização ','muito satisfeito','1','2','1','1','1','1','1','1',11,'2015-01-19 09:32:45'),(5,'2','Tempo de atendimento, estoques reais, prestação de serviço.','analisar as emergências em agendamento, realocar os agendamentos conforme estoque baixo,','1','1','1','1','1','2','2','2',281,'2015-01-20 12:39:10'),(6,'2','..','..','2','2','2','2','2','2','2','2',138,'2015-01-21 16:15:09'),(7,'2','Sempre haver melhorias a serem desenvolvidas.','Pendência de alguns relatórios estratégicos já discutidos nas reuniões do Comitê de Clientes.\r\nEx. Qualificação de Fornecedor informatizada;\r\nEx. Divergências de estoque referente inventário rotativo.','2','1','2','2','2','2','2','2',146,'2015-01-23 19:14:45'),(8,'2',' O modelo  de operação é bom e trouxe muitos benefícios a área de suprimento hospitalar.\r\nA equipe de  logística interna é muito boa.','1. Implantar uma interface de sistema que contenha os resultados do  relatório de  inspeção de recebimento e contemple as necessidades técnicas do cliente e de compras \r\n2. Melhorar a qualidade da informação e indicadores\r\n3.Criar a interface com compras para verificação se a marca do produto comprado foi a mesma do produto entregue\r\n4. Aprimorar o sistema de agendamento\r\n','2','2','2','1','2','3','2','2',198,'2015-01-28 17:12:52'),(9,'2','-O novo portal do CEADIS melhorou muito a gestão de estoque, fornecendo relatórios de revisão de pacto, consumo por setor e facilidade em visualizar agendamentos, as entregas e pendências.','-Incluir no portal a informação da marca dos produtos recebidos\r\n-Ter uma orientação homogênea entre os colaboradores do CEADIS sobre os POP\'s \r\n-Solicitar a opinião da unidade antes de incluir um novo processo, não apenas chegar e informar que houve alteração e pedir para unidade se adequar no mesmo dia.\r\n-Melhorar a forma de treinamento dos colaboradores da unidade que utilizam o kanban, não apenas com o vídeo, mas ter outras técnicas lúdicas.\r\n-Atualizações mais rápidas do saldo de estoque e das informações das entregas.\r\n-Melhorar a qualidade dos dados dos indicadores.','2','2','2','1','3','3','2','2',180,'2015-01-28 20:06:06'),(10,'2','Falta ajuste e correções.','antes de sair o material passar por controle de qualidade para evitar problemas com materiais certo/errados.','2','2','2','2','3','2','2','1',112,'2015-01-29 15:32:39'),(11,'2','agendamento','o agendamento deveria priorizar as entregas de materiais em zero no estoque, e todas NF de fornecedore s deveriam passar pela unidade para conferencia, pois quando estamos no aguardo de algum material importante para recebimento a entrega é feita parcial e temos que correr para conseguir por emprestimo ou de outro fornecedor.\r\n\r\n','3','2','1','2','1','2','2','1',141,'2015-01-30 14:05:30'),(12,'2','Atende em parte a necessidade do hospital.','Agilidade no agendamento, horário dos pedido de urgência.','3','3','2','2','2','2','2','2',76,'2015-01-30 17:07:39'),(13,'2','O serviço é inteligente e satisfaz nossas necessidades.','Ainda temos algumas divergências quanto à forma de armazenamento (alguns materiais estão ficando danificados) e a demora nos consertos dos armários.','1','2','2','1','2','1','2','2',199,'2015-02-02 10:22:32'),(14,'3','.','.','2','3','4','2','2','3','3','2',7,'2015-02-02 12:05:42'),(15,'2','Poderia Melhora os canais de atendimento.','rever os serviços prestados','3','2','2','2','2','2','4','2',68,'2015-02-05 16:39:20'),(16,'2','satisfeira','...','2','2','2','2','2','2','2','2',204,'2015-03-23 17:18:16'),(17,'2','Falta alguns ajustes','alguns ajustes no recebimento dos produtos','2','2','2','2','2','2','1','2',177,'2015-03-30 14:25:18');
